        .tree { min-height:20px; padding:19px;  margin-bottom:20px;  background-color:#fbfbfb;  border:1px solid #999;

        }
        .tree li {   list-style-type:none;   margin:0;  padding:10px 5px 0 5px;   position:relative	}
        .tree li::before, .tree li::after {  content:'';   left:-20px;   position:absolute;   right:auto }
        .tree li::before {  border-left:1px solid #999;  bottom:50px;  height:100%;  top:0;  width:1px}
        .tree li::after {  border-top:1px solid #999;   height:20px;   top:25px;  width:25px}
        .tree li span {  -moz-border-radius:5px; -webkit-border-radius:5px;	 border:1px solid #999; border-radius:5px;   display:inline-block;  padding:8px 8px;  text-decoration:none}
        .tree li.parent_li>span {  cursor:pointer}
        .tree>ul>li::before, .tree>ul>li::after {   border:0}
        .tree li:last-child::before {  height:30px	}
        .tree li.parent_li>span:hover, .tree li.parent_li>span:hover+ul li span {
            background:#eee;  border:1px solid #94a0b4;   color:#000
        }

<script>
    $(function() {
        $(window).bind("load resize", function() {
            var topOffset = 50;
            var width = (this.window.innerWidth > 0) ? this.window.innerWidth : this.screen.width;
            if (width < 768) {
                $('div.navbar-collapse').addClass('collapse');
                topOffset = 100; // 2-row-menu
            } else {
                $('div.navbar-collapse').removeClass('collapse');
            }
            var height = ((this.window.innerHeight > 0) ? this.window.innerHeight : this.screen.height) - 1;
            height = height - topOffset;
            if (height < 1) height = 1;
            if (height > topOffset) {
                $("#page-wrapper").css("min-height", (height) + "px");
            }
        });

        $("#side-menu>li").each(function () {
            $(this).click(function(){
                $(this).find('ul').slideDown();
                $(this).siblings().find('ul').slideUp();
            })
        })
    });

</script>

       var vs_treeView = function(){
        this.node = null;
        this.data = null;
        var  Args = Array.prototype.slice.call(arguments, 0);
        return this.init(Args[0])=== false ? false : this;
    }
    vs_treeView.prototype.init = function(args){
        if(!args){return false;}

        this.node = args.rootNode || null;

        if(!this.node){return false;}
        this.data = args.data || null;
        if(!this.data){return false;}

        this.initView();
        this.bindEvent();
    }

    vs_treeView.prototype.initView = function(){
        var rootUl = this.createTreeView(this.data ,1);
        this.countTree(rootUl);
        this.node.append(rootUl);
    }
    vs_treeView.prototype.countTree = function(tree , level){
        var _self = this;
        $eq = $(tree).find('li:has(ul)').filter(function(){
            return $(this).parent().is(tree) || $(this).parent().parent().is(tree);

        });
        $eq.each(function(){
            var tmp = $(this).find('li').filter('[hasContent]');
            if(tmp.length > 0){
                $(this).find('>span').append('<i class="badge">子【' +tmp.length+ '】</i>');
                _self.countTree(this);
            }
        });
    }
    vs_treeView.prototype.createTreeView = function(data , level){
        var _self = this;
        var ul = $('<ul>');

        $.each(data,function(i,o){
	
            var li = $(' <li><span  data-toggle="tooltip" data-placement="left"  ><i class=""></i> '+o.name+'</span>  ' +
                    '<a type="button" class="btn btn-success  btn-sm " href="/Game/sendLoopLight/adcode/' + o.adcode +'">编辑</a>  '
            );
            if(level != 1){
                li.css('display','none');
            }
            if(o.children ){
                li.append(_self.createTreeView( o.children , level + 1));
                li.find('>span>i').addClass('glyphicon glyphicon-plus');
            }

            if(o.content){
                li.find('>span').attr('title', o.content ).append('<i class="glyphicon glyphicon-tag" ></i>');
                li.attr('hasContent', true );
            }

            ul.append(li);
        });
        return ul;
    }
    vs_treeView.prototype.bindEvent = function(data){
        this.node.find('li:has(ul)').addClass('parent_li').find(' > span');// .attr('title', 'Collapse this branch');

        this.node.find('li.parent_li > span').on('click', function (e) {

            var children = $(this).parent('li.parent_li').find(' > ul > li');

            if (children.is(":visible")) {

                children.hide('fast');
                $(this).attr('title', 'Expand this branch').find(' >.glyphicon-minus').addClass('glyphicon-plus').removeClass('glyphicon-minus');
            } else {
                children.show('fast');
                $(this).attr('title', 'Collapse this branch').find(' >.glyphicon-plus').addClass('glyphicon-minus').removeClass('glyphicon-plus');
            }
            e.stopPropagation();

        });

        $('[data-toggle="tooltip"]').tooltip();

    }

    //
    //	    $('.tree li.parent_li > span').on('click', function (e) {

    setTimeout(function(){

        new vs_treeView({rootNode:$('.tree') , data:nodedata});
    },100);
